import React,{useState} from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { StyleSheet, Text, View } from 'react-native';
// import Practise from './screens/Practise';
import Login from './screens/Login';
import SignUp from './screens/SignUp';
import Search from './screens/Search';
import Profile from './screens/Profile';
import Chats from './screens/Chats';
import Home from './screens/Home';
import Notifications from "./screens/Notifications"
// import { AppContext } from './screens/Context/useContext';


export default function App() {


  // const [username,setUsername]=useState("zaid");

  const Stack = createNativeStackNavigator();


  return (

    // <AppContext.Provider value={{username, setUsername}}>
   <NavigationContainer>

       <Stack.Navigator  screenOptions={{ headerShown: false }} initialRouteName='notification' >
         <Stack.Screen name="notification" component={Notifications} />
         <Stack.Screen name="home" component={Home} />
         <Stack.Screen name="chat" component={ Chats} />
        <Stack.Screen name="profile" component={Profile} />
        <Stack.Screen name="search" component={Search} />
        <Stack.Screen name="login" component={Login} />
        <Stack.Screen name="signup" component={SignUp} /> 
      </Stack.Navigator>
   </NavigationContainer>
  //  </AppContext.Provider>


  );
}

const styles = StyleSheet.create({

});
